(17289, 'D8E95C7A-0754-45E6-B5E1-440AF370A268', 'As a young child, newly placed in a new foster home, I remember refusing to sleep in a bed. Previously I had been homeless with my biological mom and younger sister, and we spent our nights sleeping behind bushes in the parks of Berkeley. It wasn''t the bed that I disliked the bed. It looked warm, comfortable, and inviting.  It was because I knew my mom was somewhere, out there in the cold, sleeping on the ground, and in my not-quite 5-year-old mind, I saw the injustice in this. How could I enjoy something that was not available to others that I loved? This was my first memorable struggle with equality and accessibility. My thinking has expanded since my formative years. I no longer believe I should not have a bed to sleep in; I wonder why so many people don''t and how we can be a society that works to change that.  How do we become people who open up access and opportunities to individuals who do not look like us, come from the same ethnic or socioeconomic background, or believe like us? How do we do good in a world that says status is what matters?  Where your apparent worth is determined by how much you accomplish and how much you acquire.  Through relationships and the deep-held belief that people do not have to earn value; they have value and are worth investing in, the world becomes a better, more equitable place.  There are individuals groups that seek to expose this value and show it to the larger community. Pulling marginalized and disadvantaged people and showing that they are not the throwaways of society, but often the most gritty, hardworking, determined people you will ever meet.  I am glad to be part of Climb Hire, as it does just this. Showcasing those that society may have long overlooked. Instilling in us that, although we need skills, we already have value.', '628726453128355968', '628727145393640064', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', '+19172390518', '2020-12-03T14:14:13.128356'),
